import styled from "styled-components";
import React, { useState } from "react";
import Avartar1 from "../../dummyResources/Avartar1.png";
import MainPicDummy from "../../dummyResources/MainPicDummy.jpg";
import { Collapse } from "react-collapse";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faChevronDown } from "@fortawesome/free-solid-svg-icons";
import Dropdown from "react-dropdown";
import "react-dropdown/style.css";
import "./FeedPage.css";
import { Option } from "react-dropdown";
import Avartar from "../../components/shared/Avartar";
import { colors, Container } from "../../Styles";
import Header from "../../components/shared/Header/Header";
import HeaderTextHeading from "../../components/shared/Header/HeaderTextHeading";
import HeaderTextDescription from "../../components/shared/Header/HeaderTextDescription";
import Feed from "../../components/feed/Feed";

const options: Option[] = [
  {
    value: "안암근처",
    label: "안암근처",
    className: "drop-down-option",
  },
  {
    value: "신촌근처",
    label: "신촌근처",
    className: "drop-down-option",
  },
  {
    value: "혜화근처",
    label: "혜화근처",
    className: "drop-down-option",
  },
];

interface Props {}

interface DummyData {
  placeImgSrc: string;
  feedClosed?: boolean;
  feedTag?: string;
  feedParticipant: string[];
  feedLocation?: string;
  feedHeading: string;
  feedDetail?: string;
  feedTime?: string;
  feedCondition?: string;
}

const dummyDataa: DummyData[] = [
  {
    placeImgSrc: MainPicDummy,
    feedClosed: true,
    feedParticipant: [
      Avartar1,
      Avartar1,
      Avartar1,
      Avartar1,
      Avartar1,
      Avartar1,
      Avartar1,
    ],
    feedLocation: "참살이",
    feedHeading: "bunt 28",
    feedDetail: "#카페 #조용 $감성 #책",
    feedTime: "내일",
    feedCondition: "20세 ~ 26세",
  },
  {
    placeImgSrc: MainPicDummy,
    feedClosed: false,
    feedTag: "오늘 마감",
    feedParticipant: [Avartar1, Avartar1, Avartar1, Avartar1],
    feedLocation: "참살이",
    feedHeading: "bunt 28",
    feedDetail: "#카페 #조용 $감성 #책",
    feedTime: "내일",
    feedCondition: "20세 ~ 26세",
  },
  {
    placeImgSrc: MainPicDummy,
    feedTag: "D-1",
    feedParticipant: [Avartar1, Avartar1],
    feedLocation: "참살이",
    feedHeading: "춘자",
    feedDetail: "#과일소주 #신나는 #시끄러운",
    feedTime: "내일",
    feedCondition: "20세 ~ 26세",
  },
  {
    placeImgSrc: MainPicDummy,
    feedParticipant: [Avartar1, Avartar1, Avartar1, Avartar1, Avartar1],
    feedLocation: "참살이",
    feedHeading: "봉구비어",
    feedDetail: "#맥주 #북적북적 #시원",
    feedTime: "이번주 목요일",
    feedCondition: "20세 ~ 26세",
  },
  {
    placeImgSrc: MainPicDummy,
    feedClosed: true,
    feedParticipant: [],
    feedLocation: "참살이",
    feedHeading: "역전 할머니 맥주",
    feedDetail: "#맥주 #북적북적 #시원",
    feedTime: "이번주 금요일",
    feedCondition: "25세 ~ 29세",
  },
];

export default function FeedPage(props: Props) {
  return (
    <Container>
      <Top>
        <TopWrapper>
          <div style={{ display: "flex", alignItems: "center" }}>
            <Dropdown
              controlClassName="drop-down-className"
              options={options}
              value={options[0]}
            />
          </div>
          <RequestP>식탁 건의하기</RequestP>
        </TopWrapper>
      </Top>
      <Header src={MainPicDummy}>
        <HeaderTextHeading>친구들과 놀러가요!</HeaderTextHeading>
        <HeaderTextDescription>
          취향이 통하는 대학친구들과 즐기는 공간
        </HeaderTextDescription>
      </Header>
      <Feed
        placeImgSrc={MainPicDummy}
        feedParticipant={[Avartar1, Avartar1, Avartar1, Avartar1]}
        feedClosed={true}
        feedHeading={"bunt 28"}
        feedDetail={"#카페 #조용 $감성 #책"}
        feedLocation={"참살이"}
        feedTime={"내일"}
        feedCondition={"20세 ~ 26세"}
      ></Feed>
      {dummyDataa.map((item) => {
        return (
          <Feed
            placeImgSrc={item.placeImgSrc}
            feedParticipant={item.feedParticipant}
            feedClosed={item.feedClosed}
            feedHeading={"bunt 28"}
            feedDetail={"#카페 #조용 $감성 #책"}
            feedLocation={"참살이"}
            feedTime={"내일"}
            feedCondition={"20세 ~ 26세"}
          ></Feed>
        );
      })}
    </Container>
  );
}

const Top = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;
`;

const TopWrapper = styled.div`
  display: flex;
  width: 100%;
  padding: 12px 12px 12px 0;
  justify-content: space-between;
  margin-top: 10px;
`;

const RequestP = styled.p`
  font-size: 16px;
  font-weight: 600;
  color: ${colors.MidGray};
  padding-top: 8px;
`;
